def get_proxy_list():
    for row in urlopen('http://proxylist.fatezero.org/proxy.list').readlines():
        item=json.loads(row)
        if item['type']=='http' and item['anonymity']=='high_anonymous' and item['response_time']<7 :
            proxy_list.append(item['host']+':'+str(item['port']))

